import React, { useState } from "react";
import ApiService from "../../service/ApiService";

const PrediccionPage = () => {
  const [form, setForm] = useState({
    numAdultos: 2,
    numNinos: 1,
    tipoHabitacion: "Doble",
    precioHabitacion: 100.0,
    duracionEstadia: 3,
    diaSemanaCheckIn: "Friday",
    mesCheckIn: 4,
    antiguedadReserva: 60,
  });

  const [resultado, setResultado] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    const { name, value } = e.target;
    const parsedValue =
      ["tipoHabitacion", "diaSemanaCheckIn"].includes(name) ? value : Number(value);
    setForm((prev) => ({
      ...prev,
      [name]: parsedValue,
    }));
  };

  const handlePredecir = async () => {
    try {
      setLoading(true);
      const resultadoPrediccion = await ApiService.predecirCancelacion(form);
      console.log("🔍 Resultado recibido:", resultadoPrediccion);
      setResultado(resultadoPrediccion);
    } catch (error) {
      alert("Error al obtener la predicción.");
      console.error(error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="p-4 max-w-xl mx-auto">
      <h1 className="text-2xl font-bold mb-4">🔮 Predicción de Cancelación</h1>

      <form className="space-y-3">
        <div className="grid grid-cols-2 gap-4">
          <div>
            <label className="block text-sm font-medium">Número de Adultos</label>
            <input
              name="numAdultos"
              type="number"
              value={form.numAdultos}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            />
          </div>

          <div>
            <label className="block text-sm font-medium">Número de Niños</label>
            <input
              name="numNinos"
              type="number"
              value={form.numNinos}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            />
          </div>

          <div>
            <label className="block text-sm font-medium">Tipo de Habitación</label>
            <select
              name="tipoHabitacion"
              value={form.tipoHabitacion}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            >
              {["Doble", "Simple", "Suite"].map((tipo) => (
                <option key={tipo} value={tipo}>
                  {tipo}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium">Precio de Habitación</label>
            <input
              name="precioHabitacion"
              type="number"
              step="0.01"
              value={form.precioHabitacion}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            />
          </div>

          <div>
            <label className="block text-sm font-medium">Duración de Estancia (días)</label>
            <input
              name="duracionEstadia"
              type="number"
              value={form.duracionEstadia}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            />
          </div>

          <div>
            <label className="block text-sm font-medium">Día de la Semana del Check-In</label>
            <select
              name="diaSemanaCheckIn"
              value={form.diaSemanaCheckIn}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            >
              {["Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday", "Sunday"].map((dia) => (
                <option key={dia} value={dia}>
                  {dia}
                </option>
              ))}
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium">Mes del Check-In</label>
            <input
              name="mesCheckIn"
              type="number"
              min="1"
              max="12"
              value={form.mesCheckIn}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            />
          </div>

          <div>
            <label className="block text-sm font-medium">Antigüedad de la Reserva (días)</label>
            <input
              name="antiguedadReserva"
              type="number"
              value={form.antiguedadReserva}
              onChange={handleChange}
              className="border p-2 rounded w-full"
            />
          </div>
        </div>

        <button
          type="button"
          onClick={handlePredecir}
          className="bg-blue-600 text-white px-4 py-2 rounded w-full mt-4"
          disabled={loading}
        >
          {loading ? "Procesando..." : "Predecir Cancelación"}
        </button>
      </form>

      {resultado && typeof resultado.cancelara === "boolean" && (
        <div className="mt-6 p-4 border rounded bg-gray-100 text-center">
          <p className="text-lg font-semibold">
            {resultado.cancelara ? "❌ Cancelará la reserva" : "✅ No cancelará la reserva"}
          </p>
          <p className="text-sm text-gray-600">
            Confianza del modelo: <strong>{Math.round(resultado.confianza * 100)}%</strong>
          </p>
        </div>
      )}
    </div>
  );
};

export default PrediccionPage;
